import React from "react";
import "./Filter.css";

const Filter = ({
  filterbyKey,
  filters,
  active,
  onClickHandler,
  setfilter
}) => {
  const _filterbyKey = filterbyKey;
  console.log(filterbyKey, "filterbyKey");
  const btnFilterclusters = filters.map((filter, index) => {
    return (
      <>
        {/* <button
          key={index}
          onClick={() => {
            onClickHandler({ value: filter });
            console.log("fil==>", filter);
          }}

        >
          {filter}
        </button> */}
        <option key={index} value={filter}>
          {filter}
        </option>
      </>
    );
  });

  return (
    <div>
      <select
        onChange={(e) => {
          console.log(e);
          onClickHandler({ value: e.target.value });
        }}
      ><option default value="All">
      All
    </option>
        {btnFilterclusters}{" "}
      </select>
      <br /> <br />
      <button
        className={`${_filterbyKey === "city" ? "active" : ""}`}
        onClick={() => {
          setfilter({ filter: "city" });
          onClickHandler({ value: "All" });
        }}
      >
        city
      </button>
      <button
        className={`${_filterbyKey === "cluster" ? "active" : ""}`}
        onClick={() => {
          setfilter({ filter: "cluster" });
          onClickHandler({ value: "All" });
        }}
      >
        cluster
      </button>
      <button
        className={`${_filterbyKey === "space_available" ? "active" : ""}`}
        onClick={() => {
          setfilter({ filter: "space_available" });
          onClickHandler({ value: "All" });
        }}
      >
        space available limit
      </button>
    </div>
  );
};

export default Filter;
